import React from 'react';

const Skills = (props) => {
    return (
        <div>
            {
                    props.mesCompetences.map((itemUn) =>{
                        return(
                            <div className={itemUn.className}>
                                {
                                    props.mesCompetences.map((itemUn) =>{
                                        return(

                                                <div key={itemUn.id}>{itemUn.value}</div>

                                        )
                                    })
                                }
                            </div>
                        )
                    })
            }

        </div>
    );
};

export default Skills;
